import React from 'react'
import Todo from './Todo'
export default function TodoList({allEvents, toggleTodo}) {
    return (
        allEvents.map(allEvents =>{
           return <Todo key={allEvents.id}  allEvents={allEvents.sort((a, b) => new Date(...a.start.split('/').reverse()) - new Date(...b.start.split('/').reverse()))} toggleTodo={toggleTodo}/>
        })
      
    )
    
}
